import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css'; 

const HomePage = () => {
  return (
    <div className="home-page">
      <h1>Welcome to the AI Grading System</h1>
      <Link to="/essay-grading">
        <button className="navigate-button">Go to Essay Grading</button>
      </Link>
      <Link to="/test-grading">
        <button className="navigate-button">Go to Test Grading</button>
      </Link>
    </div>
  );
};

export default HomePage;
